package com.heraizen.cj.date11;

public class Pattern9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i, j;
		for (i = 1; i <= 3; i++) {
			for (j = 1; j < 4; j++) {
				if(i==j)
					System.out.print(19+ " ");
				else
					System.out.print("0 ");
			}

			System.out.println();
		}
	}

}
